import{_ as e,c as t,o as s,a4 as i}from"./chunks/framework.uQk9_EO2.js";const n="/docs/cocos/assets/general.RApJs6OG.png",o="/docs/cocos/assets/step.BRU5Istd.png",a="data:image/jpeg;base64,",r="/docs/cocos/assets/external-program.DZscPlio.png",l="/docs/cocos/assets/device-manager.QjsiW1Ip.png",h="/docs/cocos/assets/engine-manager.D0KVbU27.png",p="/docs/cocos/assets/asset-db.BwjlXJ87.png",c="/docs/cocos/assets/console.gUgJR4Wf.png",d="/docs/cocos/assets/inspector.DhHcwyNd.png",g="/docs/cocos/assets/preview.BN9Fzx9J.png",u="/docs/cocos/assets/animation.BXNQABil.png",m="/docs/cocos/assets/build.CfCou8LK.png",f="/docs/cocos/assets/json.DZ3w9R30.png",b="/docs/cocos/assets/build-temp.DI9R0AvU.png",y="/docs/cocos/assets/build-log-cached-engine.HC7_Z7gi.png",k="/docs/cocos/assets/laboratory.DR27q3af.png",T=JSON.parse('{"title":"Preferences","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/preferences/index.md","filePath":"en/editor/preferences/index.md","lastUpdated":1712305443000}'),w={name:"en/editor/preferences/index.md"},E=i('<h1 id="preferences" tabindex="-1">Preferences <a class="header-anchor" href="#preferences" aria-label="Permalink to &quot;Preferences&quot;">​</a></h1><p>The <strong>Preferences</strong> panel provides personalized settings for the editor, which can be opened by clicking <strong>Cocos Creator/File -&gt; Preferences</strong> in the editor&#39;s main menu bar.</p><p><strong>Preferences</strong> consists of several different tabs, including <strong>General</strong>, <strong>External Program</strong>, <strong>Device Manager</strong>, <strong>Engine Manager</strong>, <strong>AssetDB</strong>, <strong>Console</strong>, <strong>Inspector</strong>, <strong>Preview</strong>, <strong>Build</strong> and <strong>Laboratory</strong>. The <strong>Preferences</strong> panel will automatically save the changes after you modify them.</p><h2 id="general" tabindex="-1">General <a class="header-anchor" href="#general" aria-label="Permalink to &quot;General&quot;">​</a></h2><p><img src="'+n+'" alt="general"></p><p>The <strong>General</strong> tab is mainly for configuring some basic information related to the editor, including:</p><p><strong>Language</strong>: choose Chinese or English, the editor will automatically switch the language after modifying the language setting, if some texts are not switched, refresh the editor.</p><ul><li><p><strong>Number Step</strong>: used to set the step size when adjusting the numeric properties by step button in the <strong>Inspector</strong> panel. The default step size is 0.001. The step buttons in the <strong>Inspector</strong> panel include the following two types:</p><ul><li><p>When the mouse is moved to the right of the numeric property input box, a set of up and down arrows will appear, which can continuously increase or decrease the value by a certain step magnitude.</p><p><img src="'+o+'" alt="step button"></p></li><li><p>When the mouse is hovered near the name of a numeric property, the cursor will change to <img src="'+a+'" alt="mouse cursor">, and then drag the mouse left and right to increase or decrease the value continuously in a certain step.</p></li></ul></li><li><p><strong>Theme Color</strong>: set the editor display color, currently including <strong>creator</strong> and <strong>dark</strong>.</p></li></ul><h2 id="external-program" tabindex="-1">External Program <a class="header-anchor" href="#external-program" aria-label="Permalink to &quot;External Program&quot;">​</a></h2><p>The <strong>External Program</strong> tab is used to set up the development environment required to build for publishing to the native platform, as well as to configure some third-party programs. When the mouse is moved over a specific configuration item, a gray circular question mark icon is displayed on the left side. Clicking on this icon allows setting the configuration item to be applied to the current project or to all projects globally. When set to apply to the current project, the gray icon will turn yellow.</p><p><img src="'+r+'" alt="external-program"></p><ul><li><p><strong>WeChat DevTools</strong>: used to configure the Developer tools of WeChat Mini Game, please refer to the <a href="./../publish/publish-wechatgame">Publishing to WeChat Mini Game</a> documentation.</p></li><li><p><strong>Android NDK</strong>: used to set up the Android NDK path, please refer to the <a href="./../publish/setup-native-development">Setup Native Development Environment</a> documentation.</p></li><li><p><strong>Android SDK</strong>: used to set the Android SDK path, please refer to the <a href="./../publish/setup-native-development">Setup Native Development Environment</a> documentation.</p></li><li><p><strong>HarmonyOS NDK</strong>: used to set the HarmonyOS NDK path, please refer to the <a href="./../publish/publish-huawei-ohos">Publish for the Huawei HarmonyOS</a> documentation.</p></li><li><p><strong>HarmonyOS SDK</strong>: used to set the HarmonyOS SDK path, please refer to the <a href="./../publish/publish-huawei-ohos">Publish for the Huawei HarmonyOS</a> documentation.</p></li><li><p><strong>Default Script Editor</strong>: choose any executable file from an external text editing tool (e.g.: <a href="./../../scripting/coding-setup">VS Code</a>) as the way to open the script file when you double-click it in the <strong>Assets</strong> panel. The executable file of the preferred text editor can be selected by clicking the <strong>Search</strong> button after the input box. The folder icon is used to open the path to the text editor that has been set up.</p></li><li><p><strong>Default Browser</strong>: used to select the browser to be used when previewing the editor. A browser path can be specified by clicking the <strong>Search icon</strong> button behind the input box.</p></li></ul><h2 id="device-manager" tabindex="-1">Device Manager <a class="header-anchor" href="#device-manager" aria-label="Permalink to &quot;Device Manager&quot;">​</a></h2><p>The <strong>Device Manager</strong> tab is used to manage the device resolution when using the simulator or browser preview, and supports adding/modifying/deleting custom device resolutions manually on the right side of the panel. The editor&#39;s default device resolution does not support modification/deletion.</p><p><img src="'+l+'" alt="device-manager"></p><h2 id="engine-manager" tabindex="-1">Engine Manager <a class="header-anchor" href="#engine-manager" aria-label="Permalink to &quot;Engine Manager&quot;">​</a></h2><p>The <strong>Engine Manager</strong> tab is used to configure the engine path when customizing the engine.</p><p><img src="'+h+'" alt="engine-manager"></p><ul><li><p><strong>Use built-in TypeScript engine</strong>: whether to use the engine path that comes with the Cocos Creator installation path as the TypeScript engine path. This engine is used for scene rendering in the scene editor, declaration of built-in components and other engine modules in the web environment.</p></li><li><p><strong>Custom TypeScript engine path</strong>: in addition to using your own engine, an engine can also be cloned from the <a href="https://github.com/cocos/cocos-engine/" target="_blank" rel="noreferrer">engine repository</a> or forked to any local location for customization, uncheck <strong>Use built-in TypeScript engine</strong> and specify <strong>Custom TypeScript engine path</strong> as the customized engine path, then it&#39;s ready to use.</p></li><li><p><strong>Use built-in native engine</strong>: whether to use the <code>engine-naive</code> path that comes with the Cocos Creator installation path as the native engine path. This engine is used to build and compile projects for all native platforms (iOS, Android, Mac, Windows) when building.</p></li><li><p><strong>Custom native engine path</strong>: after unselecting the previous item <strong>Use built-in native engine</strong>, the native engine path can be specified manually.</p></li></ul><blockquote><p><strong>Note</strong>: the native engine used here must be from <a href="https://github.com/cocos/cocos-engine" target="_blank" rel="noreferrer">engine-native</a> or the fork of that repository.</p></blockquote><p>For details on customizing the engine, please review the <a href="./../../advanced-topics/engine-customization">Engine customization workflow</a> documentation.</p><h2 id="asset-database" tabindex="-1">Asset Database <a class="header-anchor" href="#asset-database" aria-label="Permalink to &quot;Asset Database&quot;">​</a></h2><p>The <strong>Asset database</strong> tab is used to set the <a href="./../assets/">Assets</a> panel with information about the asset database, including <strong>Log Levels</strong>, <strong>Ignore (regular)</strong> and <strong>Default Meta</strong>.</p><p><img src="'+p+`" alt="asset-db"></p><ul><li><strong>Log Level</strong>: used to set the type of information output to the <strong>console</strong> from the asset database in the <strong>Assets</strong> panel. This currently includes <strong>Error Only</strong>, <strong>Error and Warning Only</strong>, <strong>Error, Warning, and Log</strong>, and <strong>Output All Information</strong>.</li><li><strong>Ignore (Glob)</strong>: use the Glob expression and fill in the path match of the asset to be ignored, then the asset will be ignored. For example, <code>! **/*.txt</code> means that all <code>.txt</code> files are ignored.</li><li><strong>Update resources automatically</strong>: automatically refresh resources when returning to the editor from outside. See below for details.</li><li><strong>Automatically overwrite metadata on import</strong>: when importing assets to replace existing assets, if the imported assets come with Meta, use this option to set whether to overwrite the Meta of the existing assets.</li><li><strong>Default Meta</strong>: used to set the default configuration when importing assets within a project. Please refer to the description below for details.</li></ul><h3 id="update-resources-automatically" tabindex="-1">Update resources automatically <a class="header-anchor" href="#update-resources-automatically" aria-label="Permalink to &quot;Update resources automatically&quot;">​</a></h3><p>If this option is enabled, all resources will be automatically checked when returning to Creator, regardless of whether resources have been manipulated outside of Creator. Then when the number of files in the project is too high, or the random read and write speed of the hard disk is too low, it will cause the resource system response lag. For example, if a resource is selected in <strong>Assets</strong> panel, the <strong>Inspector</strong> panel will take a while to show the resource-related properties.</p><p>At this point, please disable the automatic refresh feature of Creator. After disabling this feature, if resources are manipulated, then manually click the <strong>Refresh</strong> button at the top right of the <strong>Assets</strong> panel to refresh the resources.</p><blockquote><p><strong>Note</strong>: it is not recommended to turn this option off if not experiencing resource system response problems.</p></blockquote><h3 id="default-meta" tabindex="-1">Default Meta <a class="header-anchor" href="#default-meta" aria-label="Permalink to &quot;Default Meta&quot;">​</a></h3><p>This option is used to set the default configuration when importing assets into the project. For example, if want the imported image to be <code>sprite-frame</code> by default, then click on the <strong>Edit</strong> button to the right of this option and fill in the following in the <code>json</code> file that opens:</p><div class="language-json5 vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">json5</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">{</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">    // &#39;image&#39; indicates that the type of the asset is an image.</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">    &quot;image&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: {</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">        &quot;type&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;sprite-frame&quot;</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">    }</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span></code></pre></div><p>After editing and saving, return to the editor and click the <strong>Apply</strong> button to take effect.</p><p>The asset type is <code>key</code>, and the key value <code>value</code> needs to be an <strong>object</strong>, which is the default configuration used when the asset is imported.<br> For example, in the above sample code, the <code>key</code> is <code>image</code>, the <code>value</code> is the content configured in <code>image</code>, and the configuration information of the asset database will be refreshed after clicking the <strong>Apply</strong> button, and the content in <code>image</code> will be configured into the <code>userData</code> field of the asset <code>meta</code> file one by one. For example, if <code>image.type</code> is set to <code>sprite-frame</code>, the default <code>userData.type</code> will be set to <code>sprite-frame</code> when importing image assets. So the default import configuration of various assets can be set dynamically according to project needs.</p><p>If want to get the asset type, just right-click on the asset in <strong>Assets</strong> panel, select <strong>Reveal in Explorer</strong>, then find the meta file corresponding to the asset in the opened folder and open it, the asset type will be marked in the <code>importer</code> field.</p><p>For example, the meta file for a material asset is as follows, and the <code>material</code> in the <code>importer</code> field is the asset type.</p><div class="language-json vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">json</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">{</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;ver&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;1.0.9&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">,</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;importer&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;material&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">,</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;imported&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: </span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">true</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">,</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;uuid&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;482a5162-dad9-446c-b548-8486c7598ee1&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">,</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;files&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: [</span></span>
<span class="line"><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">    &quot;.json&quot;</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">  ],</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;subMetas&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: {},</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">  &quot;userData&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: {}</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span></code></pre></div><h2 id="console" tabindex="-1">Console <a class="header-anchor" href="#console" aria-label="Permalink to &quot;Console&quot;">​</a></h2><p>The <strong>Console</strong> tab is used to set the <a href="./../console/">Console</a> panel output log, including <strong>Display date</strong> and <strong>Font size</strong>.</p><p><img src="`+c+'" alt="console"></p><ul><li><strong>Display date</strong>: whether to display the date in front of the log output from the <strong>Console</strong> panel.</li><li><strong>Font size</strong>: used to set the text size of the log output from the <strong>Console</strong> panel.</li></ul><h2 id="inspector" tabindex="-1">Inspector <a class="header-anchor" href="#inspector" aria-label="Permalink to &quot;Inspector&quot;">​</a></h2><p>The <strong>Auto-save when leaving edit</strong> option in the <strong>Inspector</strong> tab is used to set the <a href="./../inspector/">Inspector</a> panel to automatically save changes after the property edit is complete.</p><p><img src="'+d+'" alt="inspector"></p><h2 id="preview" tabindex="-1">Preview <a class="header-anchor" href="#preview" aria-label="Permalink to &quot;Preview&quot;">​</a></h2><p>The <strong>Preview</strong> tab is mainly used for the various options that can be set when using the <a href="./../preview/">Preview</a> button on the top of the editor, but is only available for the current project.</p><p><img src="'+g+'" alt="preview"></p><ul><li><strong>Auto refresh preview when saving scene</strong>: if this option is checked, the opened preview page will be automatically refreshed when saving the scene in the editor. Currently the preview using the simulator is not supported for now.</li><li><strong>Auto clear cache when using simulator</strong>: if this option is checked, the cache will be automatically cleared when using the simulator preview.</li><li><strong>Open simulator debugger</strong>: if this option is checked, the debugger will be opened automatically when previewing the project with the simulator.</li><li><strong>Simulator wait for debugger to connect</strong>: this option will take effect when <strong>Open the simulator debugger</strong> is checked, and it is used to pause the simulator startup process until the debugger is connected, which is used for debugging the loading process.</li><li><strong>Preview server port number</strong>: Port for the preview server, Cocos Creator will create a http/https server to preview game when you click the preview button.</li><li><strong>Enable HTTPS</strong>：Whether to enable HTTPS for debugging</li><li><strong>HTTPS port</strong>: Server port of HTTPS</li><li><strong>Private key</strong>: Path of the private key</li><li><strong>Public cert</strong>: Path of the public cert</li><li><strong>CSR file for certificate singing</strong>: The path of CSR file.</li></ul><h2 id="animation" tabindex="-1">Animation <a class="header-anchor" href="#animation" aria-label="Permalink to &quot;Animation&quot;">​</a></h2><p><strong>Animation</strong> Paging is used to set up the <a href="./../../animation/">animation system</a> some parameters and configurations during editing.</p><p><img src="'+u+'" alt="animation"></p><ul><li><strong>Enable animation instant cache function</strong>: when enabled, the animation in the editor will be automatically cached according to the <strong>Caching interval time</strong></li><li><strong>Cache interval time</strong>: the time between caches, in milliseconds.</li><li><strong>Maximum number of cached files</strong>: the maximum number of animations that can be cached</li></ul><blockquote><p><strong>Note</strong>: Currently the cached animation files are not automatically restored, if you want to restore the cached files, please refer to <a href="./../../animation/">Animation System</a>.</p></blockquote><h2 id="build" tabindex="-1">Build <a class="header-anchor" href="#build" aria-label="Permalink to &quot;Build&quot;">​</a></h2><p>The <strong>Build</strong> tab is used to set up the execution of the <a href="./../publish/build-panel">Build</a>, including <strong>Log file opening method</strong> and <strong>Cache Serialized JSON of Assets</strong>.</p><p><img src="'+m+'" alt="build"></p><ul><li><p><strong>Log file opening method</strong>: This option is used to set whether to open the build log file directly or to open the directory where the log file is located, when clicking the <strong>Open Log</strong> button at the bottom left of the <a href="./../publish/build-panel">platform build task</a>. The default is to open the log file directly.</p></li><li><p><strong>Cache Serialized JSON of Assets</strong>: in order to speed up the build and reduce the repeated deserialization of unmodified assets, the serialized JSON of assets will be cached during the asset build process, which will be placed in the <code>temp/asset-db/assets/uuid/build</code> directory of the project and divided into <code>debug.json</code> and <code>release.json</code> according to <strong>debug</strong> and <strong>release</strong> mode.</p><p><img src="'+f+'" alt="build"></p><p>When a cached asset exists the build will take it directly, and this part of the cached asset will be re-updated after each asset import. This option is checked by default, but if some special requirements are encountered and want to build without storing this serialized build cache asset, just uncheck it.</p></li><li><p><strong>Cache Build Engine</strong>: Cache the compiled engine, this cache will take effect in the global directory. Developers can print this cache address by using the <code>Editor.App.temp</code> command in <strong>Developer -&gt; Switch Developer Tools</strong>:</p><p><img src="'+b+'" alt="build-temp"></p><p>With this feature, it is possible to speed up the build. This feature can also be viewed in the log at:</p><p><img src="'+y+'" alt="cached-log"></p></li><li><p><strong>Cache Compressed Texture</strong>: Cache the compressed texture assets, if the texture parameters are modified, the cache will be invalidated, the cache directory is: <code>temp/builder/CompressTexture</code>.</p></li><li><p><strong>Cache Auto Atlas</strong>：The cache of the auto-atlas can be cleared at build time, for details please refer to the <a href="./../publish/build-panel#Build Tasks">Build Tasks</a></p></li><li><p><strong>Keep UUID in the Node Component</strong>：By default, component UUIDs are not serialized into Prefabs/Assets, but are automatically generated by the engine at runtime. When enabled, the component&#39;s UUID is serialized into the corresponding Prefab/Assets at build time and remains the same at runtime and editor time.</p></li></ul><h2 id="laboratory" tabindex="-1">Laboratory <a class="header-anchor" href="#laboratory" aria-label="Permalink to &quot;Laboratory&quot;">​</a></h2><p>The <strong>Laboratory</strong> tab will occasionally provide some new technical solutions or experimental features that can be selected via a switch option to be used or not, and in most cases are turned on by default. Currently these include <strong>Scene Real-time Cache</strong> and <strong>Enable baking feature</strong>.</p><p><img src="'+k+'" alt="laboratory"></p><ul><li><p><strong>Enable Deferred Rendering Pipeline</strong>: enables or disables the deferred rendering pipeline. By default, deferred rendering pipelines are disabled. For details, see <a href="./../../render-pipeline/builtin-pipeline#延迟渲染管线">Deferred Render Pipeline</a>.</p></li><li><p><strong>Automatically update script&#39;s import path after relocation</strong>: when enabled, the import part of the script will be automatically modified and relocated to the new location when you move the script in the editor.</p></li><li><p><strong>Optimized scheduling strategy</strong>: This policy will try to merge resources when importing them multiple times repeatedly to reduce the number of scheduling times.</p></li><li><p><strong>Scene real-time cache</strong>: this item is enabled by default, it is mainly used to cache scene files to <code>temp/scene/[SCENE_UUID]/[TIME].json</code> file in project directory every once in a while during scene editing (the current time interval is 5s). In case of unexpected situation, such as scene crash, process crash, etc., when you open the editor again, a popup window will prompt you whether to apply the latest scene file in the cache.</p><blockquote><p><strong>Note</strong>: In daily use, as long as the scene is opened normally, all scene files cached before the current scene is opened will be cleared. If you have a special need to view the cache files of a specific scene, please close the corresponding scene in the editor first.</p></blockquote></li><li><p><strong>Keep scene main loop running</strong>: whether or not to allow the scene to be rendered in the same way as in the preview with a constant rendering loop.</p></li><li><p><strong>Enable native engine loading scene editor</strong>: when enabled, the rendering module inside the editor will use the native engine.</p></li><li><p><strong>Debug native engine for scene editor</strong>: whether or not the native engine scene can be enabled. When this option is enabled, it will prevent the native engine from starting and a dialog box will pop up, click to confirm before it will continue to start. It is mainly used for debugging the logic inside the scene after the native engine has been activated.</p></li><li><p><strong>Animation Embedded Player</strong>: This feature supports the user to synchronize with other particles and animations while editing the animation</p></li><li><p><strong>Animation Auxiliary Curve</strong>: If or not the animation auxiliary curve function is enabled, please check <a href="./../../animation/animation-auxiliary-curve">Auxiliary Curve Edit View</a> for details.</p></li><li><p><strong>Enable Pose-Express Function</strong>: If or not enable the animation gesture map function, please check <a href="./../../animation/animation-auxiliary-curve">Programmatic Animation</a> for more details.</p></li><li><p><strong>Enable baking feature</strong>: Use to enable the baking function, please refer to <a href="./../../concepts/scene/light/lightmap">Light Mapping</a></p></li></ul><h3 id="caution" tabindex="-1">Caution <a class="header-anchor" href="#caution" aria-label="Permalink to &quot;Caution&quot;">​</a></h3><p>In future releases, these features in <strong>Laboratory</strong> may be merged, but there is also a chance that compatibility-breaking changes may occur, or may even be removed. If needing to use these features in a development environment, please be sure to test them rigorously and keep an eye out for update announcements for new releases.</p><p>We welcome users to turn on the trial of these features and provide valuable feedback in our <a href="https://discuss.cocos2d-x.org/c/33" target="_blank" rel="noreferrer">Forum</a> to make these features more suitable for their own usage scenarios and provide more powerful help for projects.</p><h2 id="extending-the-preferences-panel" tabindex="-1">Extending the Preferences Panel <a class="header-anchor" href="#extending-the-preferences-panel" aria-label="Permalink to &quot;Extending the Preferences Panel&quot;">​</a></h2><p>Creator supports adding custom functional pages on the right side of <strong>Preferences</strong>, please refer to the <a href="./../../editor/extension/contributions-preferences">Extended Preferences</a> documentation for details.</p>',66),A=[E];function v(x,B,C,P,q,Q){return s(),t("div",null,A)}const F=e(w,[["render",v]]);export{T as __pageData,F as default};
